class RubiksCubeSolver {
  constructor() {
    this.moveHistory = [];
    this.solved = false;
  }
  
  async solveCube(cubeState) {
    const solution = await this.calculateOptimalSolution(cubeState);
    await this.executeMoves(solution);
    this.solved = true;
    return solution;
  }
}
